import React, { useState } from 'react';
import { 
  TrendingUp, 
  TrendingDown, 
  DollarSign, 
  Target,
  ArrowUpRight,
  ArrowDownRight,
  Plus,
  Minus,
  Settings,
  Clock,
  AlertTriangle,
  CheckCircle,
  XCircle
} from 'lucide-react';
import { TradingChart } from './TradingChart';

export const TradingView: React.FC = () => {
  const [selectedSymbol, setSelectedSymbol] = useState('EUR/USD');
  const [selectedTimeframe, setSelectedTimeframe] = useState('1H');
  const [orderType, setOrderType] = useState<'market' | 'limit' | 'stop'>('market');
  const [orderSide, setOrderSide] = useState<'buy' | 'sell'>('buy');
  const [orderAmount, setOrderAmount] = useState('10000');
  const [orderPrice, setOrderPrice] = useState('1.0925');

  const symbols = [
    { pair: 'EUR/USD', price: '1.0854', change: '+0.12%', volume: '2.4M', trend: 'up' },
    { pair: 'GBP/USD', price: '1.2654', change: '-0.08%', volume: '1.8M', trend: 'down' },
    { pair: 'USD/JPY', price: '148.23', change: '+0.25%', volume: '3.1M', trend: 'up' },
    { pair: 'AUD/USD', price: '0.6543', change: '+0.18%', volume: '1.2M', trend: 'up' },
    { pair: 'USD/CAD', price: '1.3542', change: '-0.05%', volume: '0.9M', trend: 'down' },
  ];

  const timeframes = ['1M', '5M', '15M', '1H', '4H', '1D', '1W'];

  const recentOrders = [
    { id: 1, pair: 'EUR/USD', type: 'BUY', amount: '10,000', price: '1.0854', time: '14:32:15', status: 'filled' },
    { id: 2, pair: 'GBP/USD', type: 'SELL', amount: '5,000', price: '1.2654', time: '14:28:42', status: 'pending' },
    { id: 3, pair: 'USD/JPY', type: 'BUY', amount: '15,000', price: '148.23', time: '14:25:18', status: 'filled' },
    { id: 4, pair: 'AUD/USD', type: 'SELL', amount: '8,000', price: '0.6543', time: '14:22:05', status: 'cancelled' },
  ];

  const openPositions = [
    { id: 1, pair: 'EUR/USD', type: 'BUY', amount: '10,000', openPrice: '1.0854', currentPrice: '1.0925', pnl: '+$71', pnlPercent: '+0.65%' },
    { id: 2, pair: 'GBP/USD', type: 'SELL', amount: '5,000', openPrice: '1.2654', currentPrice: '1.2630', pnl: '+$12', pnlPercent: '+0.19%' },
    { id: 3, pair: 'USD/JPY', type: 'BUY', amount: '15,000', openPrice: '148.23', currentPrice: '148.45', pnl: '+$22', pnlPercent: '+0.15%' },
  ];

  const handlePlaceOrder = () => {
    // Simular colocación de orden
    console.log('Orden colocada:', { orderType, orderSide, orderAmount, orderPrice });
  };

  const getStatusIcon = (status: string) => {
    switch (status) {
      case 'filled':
        return <CheckCircle className="w-4 h-4 text-green-400" />;
      case 'pending':
        return <Clock className="w-4 h-4 text-yellow-400" />;
      case 'cancelled':
        return <XCircle className="w-4 h-4 text-red-400" />;
      default:
        return <AlertTriangle className="w-4 h-4 text-gray-400" />;
    }
  };

  return (
    <div className="p-6 space-y-6">
      {/* Header */}
      <div className="flex items-center justify-between">
        <div>
          <h1 className="text-2xl font-bold text-white">Trading en Vivo</h1>
          <p className="text-gray-400">Plataforma de trading profesional con IA</p>
        </div>
        <div className="flex items-center space-x-3">
          <div className="flex items-center space-x-2 bg-green-500/20 border border-green-500/30 rounded-lg px-3 py-2">
            <div className="w-2 h-2 bg-green-400 rounded-full animate-pulse"></div>
            <span className="text-sm text-green-400 font-medium">Trading Activo</span>
          </div>
          <button className="trading-button px-4 py-2">
            <Settings className="w-4 h-4 mr-2" />
            Configuración
          </button>
        </div>
      </div>

      <div className="grid grid-cols-1 lg:grid-cols-4 gap-6">
        {/* Panel de símbolos */}
        <div className="lg:col-span-1">
          <div className="trading-card p-4">
            <h3 className="text-lg font-semibold text-white mb-4">Símbolos</h3>
            <div className="space-y-2">
              {symbols.map((symbol, index) => (
                <button
                  key={index}
                  onClick={() => setSelectedSymbol(symbol.pair)}
                  className={`w-full flex items-center justify-between p-3 rounded-lg transition-all ${
                    selectedSymbol === symbol.pair
                      ? 'bg-blue-500/20 border border-blue-500/30'
                      : 'bg-gray-800/50 hover:bg-gray-700/50'
                  }`}
                >
                  <div className="flex items-center space-x-3">
                    <div className="w-8 h-8 bg-gradient-to-r from-blue-500 to-teal-500 rounded-lg flex items-center justify-center">
                      <span className="text-xs font-bold text-white">{symbol.pair.split('/')[0]}</span>
                    </div>
                    <div>
                      <p className="font-semibold text-white">{symbol.pair}</p>
                      <p className="text-xs text-gray-400">Vol: {symbol.volume}</p>
                    </div>
                  </div>
                  <div className="text-right">
                    <p className="font-semibold text-white">{symbol.price}</p>
                    <div className="flex items-center space-x-1">
                      {symbol.trend === 'up' ? (
                        <ArrowUpRight className="w-3 h-3 text-green-400" />
                      ) : (
                        <ArrowDownRight className="w-3 h-3 text-red-400" />
                      )}
                      <span className={`text-xs ${symbol.trend === 'up' ? 'text-green-400' : 'text-red-400'}`}>
                        {symbol.change}
                      </span>
                    </div>
                  </div>
                </button>
              ))}
            </div>
          </div>
        </div>

        {/* Gráfico principal */}
        <div className="lg:col-span-2">
          <TradingChart symbol={selectedSymbol} timeframe={selectedTimeframe} />
        </div>

        {/* Panel de órdenes */}
        <div className="lg:col-span-1 space-y-6">
          {/* Nueva orden */}
          <div className="trading-card p-4">
            <h3 className="text-lg font-semibold text-white mb-4">Nueva Orden</h3>
            
            {/* Tipo de orden */}
            <div className="mb-4">
              <label className="block text-sm text-gray-400 mb-2">Tipo de Orden</label>
              <div className="grid grid-cols-3 gap-2">
                {[
                  { id: 'market', name: 'Mercado', color: 'bg-blue-500' },
                  { id: 'limit', name: 'Límite', color: 'bg-green-500' },
                  { id: 'stop', name: 'Stop', color: 'bg-red-500' },
                ].map((type) => (
                  <button
                    key={type.id}
                    onClick={() => setOrderType(type.id as any)}
                    className={`px-3 py-2 rounded text-xs font-medium transition-colors ${
                      orderType === type.id
                        ? `${type.color} text-white`
                        : 'bg-gray-700 text-gray-300 hover:bg-gray-600'
                    }`}
                  >
                    {type.name}
                  </button>
                ))}
              </div>
            </div>

            {/* Compra/Venta */}
            <div className="mb-4">
              <label className="block text-sm text-gray-400 mb-2">Lado</label>
              <div className="grid grid-cols-2 gap-2">
                <button
                  onClick={() => setOrderSide('buy')}
                  className={`px-4 py-2 rounded font-medium transition-colors ${
                    orderSide === 'buy'
                      ? 'bg-green-500 text-white'
                      : 'bg-gray-700 text-gray-300 hover:bg-gray-600'
                  }`}
                >
                  <Plus className="w-4 h-4 inline mr-2" />
                  Comprar
                </button>
                <button
                  onClick={() => setOrderSide('sell')}
                  className={`px-4 py-2 rounded font-medium transition-colors ${
                    orderSide === 'sell'
                      ? 'bg-red-500 text-white'
                      : 'bg-gray-700 text-gray-300 hover:bg-gray-600'
                  }`}
                >
                  <Minus className="w-4 h-4 inline mr-2" />
                  Vender
                </button>
              </div>
            </div>

            {/* Cantidad */}
            <div className="mb-4">
              <label className="block text-sm text-gray-400 mb-2">Cantidad</label>
              <input
                type="text"
                value={orderAmount}
                onChange={(e) => setOrderAmount(e.target.value)}
                className="w-full trading-input px-3 py-2"
                placeholder="10000"
              />
            </div>

            {/* Precio */}
            {orderType !== 'market' && (
              <div className="mb-4">
                <label className="block text-sm text-gray-400 mb-2">Precio</label>
                <input
                  type="text"
                  value={orderPrice}
                  onChange={(e) => setOrderPrice(e.target.value)}
                  className="w-full trading-input px-3 py-2"
                  placeholder="1.0925"
                />
              </div>
            )}

            {/* Botón de orden */}
            <button
              onClick={handlePlaceOrder}
              className={`w-full py-3 rounded-lg font-semibold transition-all ${
                orderSide === 'buy'
                  ? 'bg-green-500 hover:bg-green-600 text-white'
                  : 'bg-red-500 hover:bg-red-600 text-white'
              }`}
            >
              {orderSide === 'buy' ? 'Comprar' : 'Vender'} {selectedSymbol}
            </button>
          </div>

          {/* Posiciones abiertas */}
          <div className="trading-card p-4">
            <h3 className="text-lg font-semibold text-white mb-4">Posiciones Abiertas</h3>
            <div className="space-y-3">
              {openPositions.map((position) => (
                <div key={position.id} className="bg-gray-800/50 rounded-lg p-3">
                  <div className="flex items-center justify-between mb-2">
                    <div className="flex items-center space-x-2">
                      <div className={`w-2 h-2 rounded-full ${
                        position.type === 'BUY' ? 'bg-green-400' : 'bg-red-400'
                      }`} />
                      <span className="font-semibold text-white">{position.pair}</span>
                      <span className={`text-xs px-2 py-1 rounded ${
                        position.type === 'BUY' 
                          ? 'bg-green-500/20 text-green-400' 
                          : 'bg-red-500/20 text-red-400'
                      }`}>
                        {position.type}
                      </span>
                    </div>
                    <span className={`text-sm font-semibold ${
                      position.pnl.startsWith('+') ? 'text-green-400' : 'text-red-400'
                    }`}>
                      {position.pnl}
                    </span>
                  </div>
                  <div className="flex items-center justify-between text-xs text-gray-400">
                    <span>{position.amount}</span>
                    <span>{position.currentPrice}</span>
                    <span>{position.pnlPercent}</span>
                  </div>
                </div>
              ))}
            </div>
          </div>
        </div>
      </div>

      {/* Órdenes recientes */}
      <div className="trading-card p-6">
        <h3 className="text-lg font-semibold text-white mb-4">Órdenes Recientes</h3>
        <div className="overflow-x-auto">
          <table className="w-full trading-table">
            <thead>
              <tr>
                <th className="text-left">Par</th>
                <th className="text-left">Tipo</th>
                <th className="text-left">Cantidad</th>
                <th className="text-left">Precio</th>
                <th className="text-left">Hora</th>
                <th className="text-left">Estado</th>
              </tr>
            </thead>
            <tbody>
              {recentOrders.map((order) => (
                <tr key={order.id}>
                  <td className="font-semibold text-white">{order.pair}</td>
                  <td>
                    <span className={`text-xs px-2 py-1 rounded ${
                      order.type === 'BUY' 
                        ? 'bg-green-500/20 text-green-400' 
                        : 'bg-red-500/20 text-red-400'
                    }`}>
                      {order.type}
                    </span>
                  </td>
                  <td className="text-gray-300">{order.amount}</td>
                  <td className="text-gray-300">{order.price}</td>
                  <td className="text-gray-400">{order.time}</td>
                  <td>
                    <div className="flex items-center space-x-2">
                      {getStatusIcon(order.status)}
                      <span className="text-sm capitalize">{order.status}</span>
                    </div>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </div>
    </div>
  );
};
